import VueSlider from "vue-slider-component";

export default {
  components: {
    VueSlider
  },
  data() {
    return {
      sliderValue: this.value
    };
  },
  props: ["min", "max", "value", "onChange"],
  watch: {
    sliderValue: function(size) {
      this.onChange(size);
    }
  }
};
